import React from "react";
import MovieBox from "./MovieBox"

export default function List(props) {
  let boxes = [];
  for (let x = 0; x < 10; x++) {
    boxes.push(<MovieBox name='hi'/>)
  } 

  return (
    <article className="list"></article>
  )
}
